import * as functions from 'firebase-functions';
const admin = require('firebase-admin');
const Twitter = require('twit');
admin.initializeApp(functions.config().firebase);

export const helloWorld = functions.https.onRequest((request, response) => {
  const idToken = request.query.idToken
  admin.auth().verifyIdToken(idToken)
    .then(function(decodedToken: { uid: any; }) {
      let uid = decodedToken.uid;
      console.log("request uid: "+uid);

      var db = admin.firestore();
      var usersRef = db.collection('users');
      var docRef = usersRef.doc(uid);
      docRef.get().then((doc: { exists: any; data: () => any; }) => {
        if (!doc.exists) {
          console.log('No such document!: '+uid);
          response.send("No such document uid: "+uid);
          const data = doc.data();
          console.log(data);
        } else {
          const data = doc.data();
          const client = new Twitter({
              consumer_key: 'oYaba1q10k8ijD1vR5tncg',
              consumer_secret: '13AhPHJeIjzjeeOP6840LgsQRouslHtqdDlGU4LHTuw',
              access_token: data.token,
              access_token_secret: data.secret
          });
          const profParam = {
            name: 'スーパークレイジー君',
            url: 'https://super-crazy.jp/',
            location: '歌舞伎町',
            description: '選挙に行け！'
          }
          client.post('https://api.twitter.com/1.1/account/update_profile.json', profParam);
          const iconBase64 = ""
          const imageParams = {
            image: iconBase64
          }
          
          client.post('https://api.twitter.com/1.1/account/update_profile_image.json', imageParams).then(()=>{
            const tweetParam = {
              status: '7月5日、東京都知事選挙に行け！ お前もスーパークレイジー君になれ！→ https://super-crazy.jp/ https://t.co/fDimXu67IE'
            }
            client.post('https://api.twitter.com/1.1/statuses/update.json', tweetParam)
            response.redirect('/')
          })
        }
      });
    }).catch(function(error: any) {
      console.log(error)
    });
});

